import { Injectable } from '@angular/core';


export const environment = {
  url: 'https://devtest.a2g.io'
};

@Injectable()
export class EnvironmentService {
  apiToken: string;

  constructor() {
    const storedToken = localStorage.getItem('token');

    this.apiToken = storedToken ? storedToken : '';
  }
}
